import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import reportWebVitals from './reportWebVitals';
import App2 from './components/formularioCorreo'
import Formulario  from '/components/formulario'
const redirectToGoogle = () => {
  window.location.href = "./components/form2.html";
};


const body = {
  backgroundColor: 'pink'
};


const App = () => {
  return (
    <div>
      {body.name}
      {/* Contenido de tu aplicación */}
      <h1>Tu aplicación aquí</h1>
      <button onClick={redirectToGoogle}>Ir a Google</button>
    </div>
  );
};

ReactDOM.render(
  <React.StrictMode>

    <Formulario/>
    <App2/>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

reportWebVitals();
